import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
  useParams,
} from "react-router-dom";

const CountryPage = () => {
  const { country } = useParams();
  return <h3>Country: {country}</h3>;
};

export default CountryPage;
